-7a977f0801a9" id="urn:x-metanorma-xml-id:_9bf2bdd5-edef-f739-0ba7-7a977f0801a9">地域地区。都市計画法第8条に基づき、都市計画区域内の土地をその利用目的によって区分し、建築物などに対するルールを決め、土地の合理的な利用を図るために指定された区域。下位の地物型として定義されていない地域地区を記述したい場合にのみ、この地物型を使用し、属性「urf:function」でその内容を識別する。下位の地物型として定義されている場合は、必ず下位の地物型を使用すること。</p><figure about="urn:x-metanorma-xml-id:_746695eb-c67c-773b-07c8-a44eeccbce07" id="urn:x-metanorma-xml-id:_746695eb-c67c-773b-07c8-a44eeccbce07"><figcaption class="style_figCaption">urf:DistrictsAndZones及び下位型の例</figcaption><img src="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA/wAAALYCAIAAABOiW44AAAgAElEQVR4nOy9WY8kSZIm9omIqh1+hseVd2ZV1tVVfWx3z7GLBbnkPgwBPvDX8A/sT+EPIEDwiS8ECC4IAkTP9PT0dncdWVV5RGZkZMbp4ZeZqaoIH8w9wiOPmt5hzy7YGx8CXl7mZmp6yC2immRmuMY1rnGNa1zjGte4xjWu8ecL/s/dgWtc4xrXuMY1rnGNa1zjGv+8uDb6r3GNa1zjGte4xjWucY0/c1wb/de4xjWucY1rXOMa17jGnzmujf5rXOMa17jGNa5xjWtc488c10b/Na5xjWtc4xrXuMY1rvFnjmuj/xrXuMY1rnGNa1zjGtf4M4f7z92BFQygte9vgN668qd99Z/2Fev9/6c1e9HCP+vA/4ygAC5c2D/5gl7jzwpXiOVdP+H9N/zJ3/ifAvrmu3+4P/+03v5Jx/j/CwH4n1hP/ZeFP5IT/7k460+pUOy/WMJQAArG/9cV+sdX+T+zhP1nxNrI/gg6/GPm4QeMfjUzIkkwMYJBGYYkkPe+Tg1My88V2kYUMAPRskMKkBkRKWCr9kGrUb1H4utKEPDaD7r8rgDICEZEMCwbvxi8mRkRA6YAQJfcTJfvfQvtU6tbjUAMJJhc7Vn7bx1Qe6caQDDAAFln+DfGdgE2s+Wz65LOVn2ndr4AevvV75CMF62tvhhgy9Zo9Z1Wjy+vX/Qura/dG/18Y8jv6PPyOrczd3FxdeebjQAwvViLi0sAtdfVzIxknd5Nl1S0vM0AQNnahVSAYSBA15aVACCtyO+NfpgZtQ3RqjmmywdtRbirlxrW1noNetngsiWh1eh0dalt2ez9k3zRZ101y22bV7iO9IKtGAaYgs0gy+Xjd8zqWj8NJhcveGtC/lGsLf2b/9vyS8spuPoi/uMevyDdlu8un1IQv228/jF44yG9EIyawIK3floRA1TBvOyVtd8vWQZQAqC8ehIAX4hmeqNZW11d8eN71mjVjgEGpZbwljR/IUDfS3prza2JUIXa1VlQKIMUCjBfCBfALAEXbKJm1ErRq9Oob/Ewg5ZjVADLibrkvvQuesMP0KEBUFgrQGG2PlG27AvR8rqtxNo/DWrtIl+9Sqv1eud1vKHjrrTXmjhX1PNyxfUtLmj1IAAjMgPjysUlE9lVOlkXTW/gjblsO2nv4Zh3LEjb/tr9tE7M77n/T4KVSlrRv155ndoFo5qZkRmMIOu3rTQjJYBwKYIu8B8lN3Q1uwpl4zcMkvaVBhMY1JRbScUXc7W8wUAERkuf7XSvGzB00XOCXXDNaiC6pqavdOwKc7UCXw0sZqakBKKlFP2Pk5SX+mtl57wtbN8Q3e+5qC2pG0yWsmXZ1NsEtBxyqx5X74Ua2NofFSBLhKVAvnjoXT15h9jlt7+v2Kdt4Yrl9v5Z0QuZ9sYrFcarjhrAS6WAC13wfgX3zpcqlC f6-c492-327e-9e02-243b78af63bb" id="urn:x-metanorma-xml-id:_6db60cf6-c492-327e-9e02-243b78af63bb">gml:MultiSurface [0..1]</p></td><td><p about="urn:x-metanorma-xml-id:_52766a80-85d3-c399-279c-f25bf66f15e5" id="urn:x-metanorma-xml-id:_52766a80-85d3-c399-279c-f25bf66f15e5">区域の範囲。高さを0とする。計画図に示す区域の境界線に囲まれた平面的な範囲を指す。</p></td></tr><tr><td><p about="urn:x-metanorma-xml-id:_b1aba6d0-9241-1345-02fa-498a34a8393a" id="urn:x-metanorma-xml-id:_b1aba6d0-9241-1345-02fa-498a34a8393a">urf:keyValuePairAttribute</p></td><td><p about="urn:x-metanorma-xml-id:_6d4a8487-c5a7-f648-4de2-28adb2009e68" id="urn:x-metanorma-xml-id:_6d4a8487-c5a7-f648-4de2-28adb2009e68">uro:KeyValuePairAttribute [0..*]</p></td><td><p about="urn:x-metanorma-xml-id:_1c8fe26e-33e6-c819-5e80-6fc1a4ac4c84" id="urn:x-metanorma-xml-id:_1c8fe26e-33e6-c819-5e80-6fc1a4ac4c84">コード属性を拡張するための仕組み。コ－ド値以外の属性を拡張する場合は、gen:_GenericAttributeの下位型を使用する。</p></td></tr><tr><td><p about="urn:x-metanorma-xml-id:_2dea4aa5-2ae9-6666-637a-64e8310506ed" id="urn:x-metanorma-xml-id:_2dea4aa5-2ae9-6666-637a-64e8310506ed">urf:dataQualityAttribute</p></td><td><p about="urn:x-metanorma-xml-id:_d748d2a7-1ae2-734f-f996-48df0daabb43" id="urn:x-metanorma-xml-id:_d748d2a7-1ae2-734f-f996-48df0daabb43">uro:DataQualityAttribute [0..1]</p></td><td><p about="urn:x-metanorma-xml-id:_9076ff84-09d1-f2c1-01a4-bcafd4da5d8c" id="urn:x-metanorma-xml-id:_9076ff84-09d1-f2c1-01a4-bcafd4da5d8c">作成したデータの品質に関する情報。必須とする。</p></td></tr><tr><td><p about="urn:x-metanorma-xml-id:_bfea0f4b-7a57-a48e-893e-2ab91fefbc46" id="urn:x-metanorma-xml-id:_bfea0f4b-7a57-a48e-893e-2ab91fefbc46">urf:boundary</p></td><td><p about="urn:x-metanorma-xml-id:_2adc9c19-4b99-6f11-e192-fe5f6ec1ae58" id="urn:x-metanorma-xml-id:_2adc9c19-4b99-6f11-e192-fe5f6ec1ae58">urf:Boundary [0..*]</p></td><td><p about="urn:x-metanorma-xml-id:_00496529-608a-937b-5374-9699c1e7694f" id="urn:x-metanorma-xml-id:_00496529-608a-937b-5374-9699c1e7694f">区域を構成する境界。地域地区の外周及び内周となる境界線。</p></td></tr></tbody></table></figure></
